Q:

How to slide up when click any outside of div? (jQuery)

I have a div that slides up when I click on it. I want to make it slide up when I click anywhere outside of the div. How can I do this?
Here is my code:
$(document).ready(function(){
    $("#slide").click(function(){
        $("#slide").animate({height: "toggle"}, 500);
    });
});

A:

You can use the click event on the document and check if the clicked element is the div or not. If it is not, then you can slide it up.
$(document).ready(function(){
    $("#slide").click(function(){
        $("#slide").animate({height: "toggle"}, 500);
    });

    $(document).click(function(e){
        if(!$(e.target).is("#slide")){
            $("#slide").animate({height: "toggle"}, 500);
        }
    });
});

